import { Route, Navigate} from "react-router-dom"

export default function RouteWrapper({
    component: Component,
    isPrivate,
    ...rest
}){

    const loading = false
    const signed = false

    if(loading){
        return(
            <div></div>
        )
    }

    if(!signed && isPrivate){
        return <Navigate to="/"/>
    }

    if(signed && !isPrivate){
        return <Navigate to="/dashboard"/>
    }

    return(
        <Route
            {...rest}
            render={ props =>(
                <Component{...props}/>
            )}
        />
    )
}
